package com.aslan.pay.model;import jakarta.persistence.*;import lombok.*;import java.io.Serializable;@Builder@Setter@Getter@NoArgsConstructor@AllArgsConstructor@Data@Table(name = "merchant")@Entitypublic class Merchant implements Serializable {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Long id;    @Column(name = "type")    private int type;    @Column(name = "name")    private String name;    @Column(name = "cashback")    private double cashback;    @Column(name = "time")    private int time;    @Column(name = "link")    private String link;    @Column(name = "img")    private String img;}